var sockEventShowError=function(e){e.on("errmsg",function(e){err=document.getElementById("mesg_bar"),err.className="mesg_bar "+e.color,err.innerText=e.mesg}),e.on("conn-conf",function(e){var t=document.getElementById("clientID"),n=document.getElementById("nameSpace");if(!t){alert("clientID not defined.");return}if(!n){alert("nameSpace not defined.");return}t.value=e.clientID,n.value=e.nameSpace})};